CPU is the ultimate interpreter . That is, it executes opcodes as it goes. To do that, after we have changed the representation (aka lowered the representation) of our source code &str to AST Node, a basic interpreter looks at each node of the AST (via any tree traversal methods ) and simply evaluates it recursively pub fn eval(&self, node: &Node) -> i32 { match node { Node::Int(n) => *n, Node::UnaryExpr { op, child } => { let child = self.eval(child); match op { Operator::Plus => child, Operator::Minus => -child, } } Node::BinaryExpr { op, lhs, rhs } => { let lhs_ret = self.eval(lhs); let rhs_ret = self.eval(rhs); match op { Operator::Plus => lhs_ret + rhs_ret, Operator::Minus => lhs_ret - rhs_ret, } } } } To sum up, we define a Compile trait that we will use throughout this chapter pub trait Compile { type Output; fn from_ast(ast: Vec<Node>) -> Self::Output; fn from_source(source: &str) -> Self::Output { println!("Compiling the source: {}", source); let ast: Vec<Node> = parser::parse(source).unwrap(); println!("{:?}", ast); Self::from_ast(ast) }
} and we can now implement our interpreter pub struct Interpreter; impl Compile for Interpreter { type Output = Result<i32>; fn from_ast(ast: Vec<Node>) -> Self::Output { let mut ret = 0i32; let evaluator = Eval::new(); for node in ast { ret += evaluator.eval(&node); } Ok(ret) }
} Filename: calculator/src/compiler/interpreter.rs and test assert_eq!(Interpreter::from_source("1 + 2").unwrap(), 3); Run such tests locally with cargo test interpreter --tests

