From previous example, our interpreter goes through the bytecode instructions and executes them. Continuing our "1 + 2" Bytecode example, instructions: [1, 0, 0, 1, 0, 1, 3, 2], -------- -------- - - | | | |
constants: [ Int(1), Int(2)] OpAdd OpPop [1, 0, 0] points to the first element in constants table i.e. Int(1)
[1, 0, 1] points to Int(2)
[3] (or [0x03]) corresponding to the Opcode *OpAdd*, performs the addition operation Int(1 + 2)
[2] (or [0x02]) corresponding to the Opcode *OpPop* pops out the computed Bytecodes and since we want to model our runtime as a Stack Machine so we define our VM as struct with Bytecode, stack memory (in Stack Machine) and a stack pointer to the next free space const STACK_SIZE: usize = 512; pub struct VM { bytecode: Bytecode, stack: [Node; STACK_SIZE], stack_ptr: usize, // points to the next free space
} and with the help of instruction pointer (IP) , we execute the Bytecodes as follows pub fn run(&mut self) { let mut ip = 0; // instruction pointer while ip < self.bytecode.instructions.len() { let inst_addr = ip; ip += 1; match self.bytecode.instructions[inst_addr] { 0x01 => { //OpConst let const_idx = convert_two_u8s_to_usize( self.bytecode.instructions[ip], self.bytecode.instructions[ip + 1], ); ip += 2; self.push(self.bytecode.constants[const_idx].clone()); } 0x02 => { //OpPop self.pop(); } 0x03 => { // OpAdd match (self.pop(), self.pop()) { (Node::Int(rhs), Node::Int(lhs)) => self.push(Node::Int(lhs + rhs)), _ => panic!("Unknown types to OpAdd"), } } 0x04 => { // OpSub match (self.pop(), self.pop()) { (Node::Int(rhs), Node::Int(lhs)) => self.push(Node::Int(lhs - rhs)), _ => panic!("Unknown types to OpSub"), } } 0x0A => { // OpPlus match self.pop() { Node::Int(num) => self.push(Node::Int(num)), _ => panic!("Unknown arg type to OpPlus"), } } 0x0B => { // OpMinus match self.pop() { Node::Int(num) => self.push(Node::Int(-num)), _ => panic!("Unknown arg type to OpMinus"), } } _ => panic!("Unknown instruction"), } } } pub fn push(&mut self, node: Node) { self.stack[self.stack_ptr] = node; self.stack_ptr += 1; // ignoring the potential stack overflow } pub fn pop(&mut self) -> Node { // ignoring the potential of stack underflow // cloning rather than mem::replace for easier testing let node = self.stack[self.stack_ptr - 1].clone(); self.stack_ptr -= 1; node } Filename: calculator/src/compiler/vm/vm.rs To examine the generated Bytecodes and run our VM, we can do let byte_code = Interpreter::from_source(source);
println!("byte code: {:?}", byte_code);
let mut vm = VM::new(byte_code);
vm.run();
println!("{}", vm.pop_last()); Run tests locally for our VM with cargo test vm --tests Checkout the next section on how to create a REPL for our Calc to compare different compilation paths.
